class Timer(QThread):
    trigger=pyqtSignal(int)
    moving=0
    time_number=0
    def __init__(self):
        super(Timer, self).__init__()
        self.time_number = 0

    def foo(self, number):
        self.time_number = number

    def run(self):
        self.moving=1
        while self.moving==1:
            self.time_number += 1
            self.trigger.emit(int(self.time_number))
            time.sleep(1)
    def stop(self):
        self.time_number-=3
        self.moving=0
        self.trigger.emit(int(self.time_number))

